records.addlTxt:
Defendant Jodee Lynn Michell in court with attorney Mark S. Tishberg.  Kimberly Dorice Schoepp appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Defendant prepared to enter change of plea.  Hearing proceeded.  Negotiations set forth by the state.

AS TO COUNT 1:  The defendant was advised of her constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum to Plea Questionnaire, and Jury Instructions received and filed.  The parties stipulate to the complaint as a factual basis for the plea after clarifications set forth on the record.  The Court found the defendant guilty and ordered entry of Judgment of Conviction.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession and Voting.  Filed, Ineligible Voting Notice and Acknowledgement.

AS TO COUNT 2:  By operation of law the Court orders Count 2 DISMISSED at this time.

Sentencing proceeded.  Statements made by the state, Daniel M., defense, and defendant. 

The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 3 YEARS, CONSECUTIVE to any other time being served with credit for 4 days served. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 18 MONTHS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 18 MONTHS.

The defendant IS NOT eligible for the Challenge Incarceration Program.  The defendant IS eligible for the Substance Abuse Program.

The Court STAYS this sentence and places the defendant on PROBATION for a period of 30 MONTHS with the following conditions:

CONDITIONS OF PROBATION/ EXTENDED SUPERVISION(if revoked):
*Serve 6 months in the House of Correction.  The Court to allow Electronic Monitoring with release for medical, dental, psychological treatment and other programming and court hearings ONLY.
*Obtain Mental health assessment- complete follow-up treatment- agent may determine if this condition is satisfied;
*Take any prescription medication only in the manner/dosage as prescribed by a treating physician;
*Obtain AODA assessment- if appropriate complete follow-up treatment;
*Absolute sobriety- random urine screens and breathalyzer tests- no drugs other than prescribed medication;
*No illegal drug dealing or association with drug community (drug users/dealers/houses);
*Cooperate with all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*Pay all supervision fees;
*Provide DNA sample- pay surcharge;

The Court ordered defendant to pay a fine of $1200.00 plus all mandatory costs, penalties, surcharges, including $50.00 ignition interlock surcharge- to be paid by the end of probation period.  Any balance to convert to civil judgment.  Bail to apply. Court ordered AODA assessment and Driver's Safety Plan; cooperate with any treatment recommended.  Court ordered defendant's driving privileges revoked for a period of 24 months.  Court ordered defendant restricted to operation of vehicles equipped with an ignition interlock device for 24 months.   If revoked, the Court ordered that all financial obligations be paid through collection of sums by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.  Any remaining balance to convert to civil judgment.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession and Voting.  Appeals rights given by the court.
